import React, { Component } from 'react';


export default class Banner extends Component {
    renderEvent() {
        return (
            <div class="row featurette">
                <div class="col-md-7">
                    <h2 class="featurette-heading">University Graduation
                        <br />
                        <span class="text-muted">May 2018</span>
                    </h2>
                    <p class="lead">Walked across the stage to receive my B.S. along with several colleagues. Best part of the day? Hearing my name pronounced correctly.
                    </p>
                </div>
                <div class="col-md-5">
                    <img class="featurette-image img-fluid mx-auto" src="img/events/graduation2.jpg" alt="Graduation Image" />
                </div>
            </div>
        )
    }

    render() {
        return (
            <div>
                {this.renderEvent()}
            </div>
        )
    }
}
